Deutsch;:
Proteus 2 nutzt die neue Technologie, die wir entwickelt haben, die verschiedene Zonen und Gebiete in eine Welt hinzufügen.

Wir haben die Menge der Weltstruktur verdoppelt, Millionen von Grasklingen gerendert und unzählige neue Alien-Folwies bevölkert - jeweils verschiedene Ressourcen.
;

Alles, was Sie auf Ihren Abenteuern beobachten, können jetzt entdeckt werden. Viel mehr als eine einfache Leistung, das Entdeckungssystem entsperrt tatsächlich alle verschiedenen Ressourcen, die auf der gefundenen Ressource ergibt.

Im Wesentlichen kann jede Waffe oder ein Werkzeug, das auf einer Ressource verwendet wird, einen anderen Artikel ergeben, wodurch die weltweit wissenschaftlichere Erkundung des Sonnensystems und aller seiner Lebensformen ermöglicht wird.
;

Mineralien können jetzt auf Ihrem aktualisierten GPS gefiltert werden. Dieses sehr praktische Tool, das jetzt immer in Ihrem HUD verfügbar ist und nicht mehr an Ihrem Locator angehängt ist, liest sich von Ihren umliegenden Satelliten und Ihrem eigenen internen Anzugradar, um Erkennungsradien zu erstellen.

Dieses System zeigt Ihnen alle umgebenden Mineralien, deren Härte und Dichte, sodass Sie finden, wonach Sie in Ihren Handwerksmissionen suchen.
;

1-1. Physische Umwelt spielt eine entscheidende Rolle im Überleben. Temperatur, Wettersysteme, Gelände und indigene Lebensformen haben alle einen direkten Einfluss auf die Gesundheit und Nachhaltigkeit. Bekanntheit dieser Elemente und der Effekt, den sie haben, ist von größter Bedeutung.

1-2. Präventive Maßnahmen, frühzeitige Anerkennung und schnelle Behandlungshilfe minimieren die Wahrscheinlichkeit einer verringerten Funktionalität und des möglichen Todes. Kurz gesagt, Bewusstsein ist der Schlüssel.
;

1-5. Das Gelände auf extra Solarplanteten kann troffig sein und müssen mit Sorgfalt durchquert werden. Jeder Fehltritt kann dazu führen, dass Sie Ihren EVA-Anzug beschädigen und zu einem Anzugsverletzung führen, der katastrophal sein kann. Es ist unangemessen, mit äußerster Vorsicht zu erkunden.

1-6. Steigung. Wenn Sie versuchen, einen Steigung zu erklimmen, sollten Sie unbedingt Ihren Neigungswarnindikator ansehen. Für Pisten, die größer als 30 Grad sind, wirft entweder in Neigung oder einen Rückgang eine Gefahr für Ihre Durchquerung auf. Das Versuch, auf diesem unebenen Gelände zu springen oder zu laufen, wird nicht beraten.

Hocke kann bei Bedarf extreme Pisten ausgeübt werden.;

3-1. Die Lebensqualität ist weitgehend von Ernährung, Hydratisierung und allgemeiner Gesundheit abhängig. Im Laufe der Zeit kann sich der körperliche Zustand verschlechtern, die Geschwindigkeit und das Überleben beeinflussen. Hunger und Durst, wenn nicht behoben, können Gesundheit und Leistung rückläufig sein. Effekt haben ebenfalls Klimatisierungsbedingungen wie Wärme und Kälte. Es ist zwingend notwendig, diese mit den bereitgestellten Anzugswerten zu überwachen.

3-2. Wenn der körperliche Zustand abnimmt und die Gesundheit beeinträchtigt ist, ist die Heilung mit bestimmten Arten von Lebensmitteln und Bandagen möglich. Heilung ist entscheidend, um das Leben aufrechtzuerhalten.
;

7-5. U.n.e. Unternehmen können sich mit anderen Personal in Kontakt kommen. In diesen Situationen kann dieses Personal mit einer Partei oder einer Kolonie eingerichtet werden.

7-6. Einrichten einer Partei: Für das Personal, das eine Partei erstellt, müssen sie auf die andere operative Wirkung gehen, sie ansehen, und drücken Sie dann [F], um eingeladen zu werden. Das Personal, das sich der Party anschließt, muss dann aussehen und den Inventar und dann in das Menü auf [Akzeptieren] klicken.
;

